var counter=0,scale=1;$(".as").each(function(){var e=$(this).parent();e=e.height();var t=$(this).parent();e<=(t=t.width())?t=e:e=t,$(this).css({height:e*scale,width:t*scale}),counter++,console.log("Resize Image#"+counter+"\nwidth:"+t+"px;\nheight:"+e+"px")});
